import styled from "styled-components";
import { useState } from "react";

function SectionDevelop() {
  const [hover, setHover] = useState(false);

  return (
    <Container id="develop">
      {hover && <BgImg src={process.env.PUBLIC_URL + hover} alt="cuckoo"></BgImg>}
      <Wrap>
        <Content>
          <Title>
            <h4>03</h4>
            <h2>Front-End Web Develop</h2>
            <h3>Endeavors for more reasonable, logical design. I have learned to create clearer, more logical and reasonable design and to increase efficiency of collaboration.</h3>
            <View></View>
          </Title>
          <ContentList>
            <li onMouseOver={() => setHover("img/main_bg01.jpg")} onMouseOut={() => setHover(null)}>
              <ListTitle>
                <h3>RESPONSIVE WEBSITE</h3>
                <div>
                  <h2>Cuckoo</h2>
                  <HoverWrap>
                    <h4>
                      <a href="https://kimahr.github.io/clonecoding/class/cuckoo">VIEW</a>
                    </h4>
                  </HoverWrap>
                </div>
              </ListTitle>
            </li>
            <li onMouseOver={() => setHover("img/main_bg02.jpg")} onMouseOut={() => setHover(null)}>
              <ListTitle>
                <h3>RESPONSIVE WEBSITE</h3>
                <div>
                  <h2>DKG Holdings</h2>
                  <HoverWrap>
                    <h4>
                      <a href="https://kimahr.github.io/clonecoding/class/cuckoo">VIEW</a>
                    </h4>
                  </HoverWrap>
                </div>
              </ListTitle>
            </li>
            <li onMouseOver={() => setHover("img/main_bg03.jpg")} onMouseOut={() => setHover(null)}>
              <ListTitle>
                <h3>RESPONSIVE WEBSITE</h3>
                <div>
                  <h2>Zinus</h2>
                  <HoverWrap>
                    <h4>
                      <a href="https://kimahr.github.io/clonecoding/class/cuckoo">VIEW</a>
                    </h4>
                  </HoverWrap>
                </div>
              </ListTitle>
            </li>
            <li onMouseOver={() => setHover("img/main_bg04.jpg")} onMouseOut={() => setHover(null)}>
              <ListTitle>
                <h3>RENEWAL WEBSITE</h3>
                <div>
                  <h2>Fresh</h2>
                  <HoverWrap>
                    <h4>
                      <a href="https://kimahr.github.io/clonecoding/class/Fresh">VIEW</a>
                    </h4>
                  </HoverWrap>
                </div>
              </ListTitle>
            </li>
          </ContentList>
        </Content>
      </Wrap>
    </Container>
  );
}

export default SectionDevelop;

const Container = styled.div`
  width: 100%;
  height: 1000px;
  margin: 0 auto;
  background-color: ${({ theme }) => theme.colors.main_color};
  position: relative;
  overflow: hidden;

  @media ${({ theme }) => theme.device.tablet} {
    width: 100%;
    height: 800px;
  }
  @media ${({ theme }) => theme.device.mobile} {
    height: 700px;
    transition: all 0.3s;
    margin-bottom: 800px;
  }
`;

const BgImg = styled.img`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  opacity: 0.2;

  overflow: hidden;
  z-index: 1;
  @media ${({ theme }) => theme.device.laptop} {
    z-index: 1;
    position: absolute;
    top: 0;
    right: 0;

    height: 100%;
    transition: all 0.3s;
  }
`;

const Wrap = styled.div`
  position: relative;
  width: 100%;
  height: 100%;
  @media ${({ theme }) => theme.device.laptop} {
    width: 100%;
    height: 100%;
    z-index: 1;
    position: absolute;
    top: 0;
    left: 0;
    background: url(../img/lang.jpg) no-repeat 50% 50%;
    background-size: cover;
    transition: all 0.3s;
  }
`;

const Content = styled.div`
  z-index: 2;
  position: absolute;
